import React from 'react';




import './mystyle.css'; 
const Header = () => {
    return(
       
        <div id="header" class="jumbotron text-center">
        <h1>Graph Maker</h1>
        <hr/>
        <p>Create any ammount of graphs and use it on your page using embeed</p>
        <br/>
        <br/>
       
        <form>
            <div class="input-group">
                
                <div class="input-group-btn" text-center="true">
                   
                    <button type="button" id="createGraph" class="btn btn-danger">Create your graphicon</button>
                </div>
            </div>
        </form>
    </div>
    )
}

export default Header;
